 thick brows and overpainted mouth that would be her permanent image. Her capacity to inspire and wear with flair the creations of the dress designer Adrian was legendary. But most of all, she was known for her hard work on the set. Joan Crawford's personal life was characterized equally by self-discipline and the determination to better herself, banishing forever her unhappy beginnings. Four husbands included actors Douglas Fairbanks, Jr, Franchot Tone, Phillip Terry and businessman Alfred Steele. Plagued by innumerable miscarriages, she adopted four children, one of whose account of Joan's unyielding perfectionism has succeded in blurring memories of the remarkable life and career of a Hollywood immortal. Among Joan Crawford's films from which clips are included: Sally, Irene and Mary, 1925; Our Dancing Daughters, 1928; Grand Hotel, 1932; Dancing Lady, 1933; The Gorgeous Hussy, 1936; The Women, 1939; A Woman's Face, 1941; Mildred Pierce, 1945; Humoresque, 1946; Possessed, 1947; Sudden Fear, 1952; Johnny Guitar, 1954 Whatever Happened to Baby Jane? 1962 and Strait Jacket, 1964.	2021-03-20	2.7		
